import React from 'react';
import logo from './logo.svg';
import nature from './nature.jpg';
import trek from './trek.png';
import './App.css';
import firstPage from './firstPage.js'

function App(){
  return (
    <div className="App">
      <header className="App-header">
        <img src={nature} className="background" alt="logo" />
        <p>
          <firstPage />
          Change Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <firstPage />
      </header>
    </div>
  );
}

export default App;
